import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

export default function NavBar() {
  return (
    <Box>
      <Tabs centered variant="standard" textColor="primary">
        <Tab label="Jobs"></Tab>
        <Tab label="ATS Scan"></Tab>
        <Tab label="Account"></Tab>
      </Tabs>
    </Box>
  );
}
